This is NOT a good time for Kanye West. After his album ‘The Life Of Pablo’ leaked online, <http://HollywoodLife.com|HollywoodLife.com> has EXCLUSIVELY learned that he is furious — and that has made him not-so-fun to be around. Poor Kim Kardashian!
Kanye West, 38, is looking into taking legal action against a website after it allowed his new album, The Life Of Pablo, to be pirated over 500,000 times. Unfortunately, even with the hope of a winning lawsuit, the artist has let the leak get under his skin.



