“Kanye is going to meet with his legal team to discuss the possibilities of starting legal action against torrent site Pirate Bay,” a source tells <http://HollywoodLife.com|HollywoodLife.com> EXCLUSIVELY. Why? Because The Life Of Pablo, his eighth and most anticipated studio album, was uploaded to the site and then shared over half a million times — allowing so-called fans to acquire his music illegally and without profit. Yikes.
Our source explained that Kanye is “furious because he’s potentially lost millions of dollars.” In this case, who can blame him for being so angry?
Unfortunately, his wife, Kim Kardashian, can. “Because of this breach, Kanye has been difficult to be around. He’s touchy, angry and feels like his material was stolen. He hates the idea of people not paying for his music and feels someone needs to be held accountable for that.” He’s right, but it sucks to hear that he could potentially be taking his anger out on his family.

