The album leak comes just after Kanye revealed to the world that he is $53 million dollars in debt. Even though that hasn’t stopped him from shopping for very expensive jewelry, he knows he took a big financial hit with the album being downloaded illegally. Those free albums will not be helping him get out of debt, that’s for sure!
