“He’s going to talk to his lawyers and see where he stands, and hopefully Tidal will partner up with him in any legal proceedings because it was supposed to be an exclusive release,” <http://HollywoodLife.com|HollywoodLife.com>‘s source shared EXCLUSIVELY. “He certainly feels he has a case, with the two factors he’s mulling over being copyright infringement and loss of earnings.”
Tell us, HollywoodLifers — What do YOU think about Kanye potentially suing the site that allowed his album to be leaked online? Comment below with your thoughts!

This doesn’t slay at all! Beyonce and Jay Z have been fighting non-stop, according to a new report. It has gotten so bad that Bey broke down at Kelly Rowland’s birthday party and announced she was planning to ‘end her marriage’ to Jay!
Beyonce, 34, may not be “crazy in love” with hubby, Jay Z, 46, anymore. When Bey joined Kelly Rowland to celebrate her fellow Destiny’s Child member’s 35th birthday, Queen Bey reportedly confessed that after seven years together, she was calling it quits with Jay! So much for Red Lobster.


