She may have found it — with her husband! Whatever caused this alleged meltdown at Kelly’s birthday, the issue seemed resolved when Bey and Jay Z attended the Feb. 29 Los Angeles Clippers game. “They were in the front row, acting very much like a couple,” an eyewitness EXCLUSIVELY told <http://HollywoodLife.com|HollywoodLife.com>, adding that Bey and the “Hard Knock Life” rapper were “showing that they were in a great mood.”
